import "./App.css";
import React, { useEffect, useState } from "react";
import Header from "./components/header";
import Introduction from "./components/Introduction";
function App() {
  const [message, setMessage] = useState({ no: "", description: "" });

  useEffect(() => {
    fetch("/api") // Ensure this matches your server endpoint
      .then((response) => response.json())
      .then((data) =>
        setMessage({ no: data.no, description: data.description })
      )
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  return (
    <>
      <Header />
      <Introduction />
    </>
  );
}

export default App;
